import { firestoreReadText } from "./FirebaseAPI";
import {TaskRow} from './TaskRow';
const TaskList = () => {
    const rows = [];
    firestoreReadText((id, text, err) => {
        if (err != null) {
            rows.push(<TaskRow displayText={text} id={id}/>);
        } else {
            return err
        }
    })
    return (
        <div>
            {rows}
        </div>
    );
}

export default TaskList;
